import React from "react";
import ReactEcharts from 'echarts-for-react';
import "./Right.css";
import Unconnect from '../Image/unconnect.png';

export const HOME_CONST = {
    POINT_LIST: [
        {
			key: '1',
			name: '胡彦斌',
			age: 32,
			address: '西湖区湖底公园1号',
		  },
		  {
			key: '2',
			name: '胡彦祖',
			age: 42,
			address: '西湖区湖底公园1号',
		  }
    ],
    BROADCAST_TAGS: [
       {
		title: '姓名',
		dataIndex: 'name',
		key: 'name',
	  },
	  {
		title: '年龄',
		dataIndex: 'age',
		key: 'age',
	  },
	  {
		title: '住址',
		dataIndex: 'address',
		key: 'address',
	  }
    ],
}
